  \"High Turndown Ratio, High Delta-Emittance, Variable Emissivity Electrochromics
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
