  \"high-turndown-ratio-high-delta-emittance-variable-emissivity-electrochromics-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Variable-emittance materials are in high
  demand for applications ranging from manned and unmanned space platforms (e.g. in
  radiators at the Moon's poles where damage could be prevented during times of low
  heat load) to spacecraft thermal control (especially for micro-, nano-spacecraft
  where no effective thermal control currently exists).  They are superior to technologies
  such as loop heat pipes, louvers, MEMS systems, electrostatic systems, phase change
  materials, and others. A key requirement is a high Turn-Down Ratio (TDR, ratio of
  high/low emittance), up to 10.0, and Delta-emittance, up to 0.55. In ongoing and
  recent prior work (for Air Force, JPL, NASA), this firm has developed a novel, patented
  variable emittance skin technology, based on conducting polymers (CPs), microporous
  membranes and ionic liquids, with proven, space-environment performance. The proposed
  work will develop this with further, radical innovations including entirely new
  CPs, to achieve a TDR of ca. 8.0 and possibly up to (from current ca. 3.0), and
  Delta-emittance of ca. 0.60 (from current ca. 0.50). The more than eight innovations
  are based on actual, prior experimental data and include  incorporation of new CPs,
  alteration of the substrates and surfaces, radical increase in doping level, use
  of new ionic liquid electrolytes with higher conductivity and several others. \",\n\t\"license_title\":
